script: |
  super -f text -I q5732.spq | sort > q5732.out

inputs:
  - name: q5732.spq
    data: |
      SELECT ALL - col1 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 * 20 + col0 * + CAST ( 64 + - col1 AS INTEGER ) NOT IN ( col2 - - col2 / - 8 );
  - name: tab0

outputs:
  - name: q5732.out
    data: |
